note_models.css:
.card {
 font-family: arial;
 font-size: 20px;
 text-align: center;
 color: black;
 background-color: white;
}

.alts {
 font-size: 14px;
}
.attrs {
 font-style: italic;
 font-size: 14px;
}
.plural {
 text-align: left;
}
.sentence {
 font-style: italic;
}

tmpls.afmt:
{{FrontSide}}

<hr id="answer" />

 {{German}}{{#Audio}}<div
style="display:none;">{{Audio}}</div>{{/Audio}}<br/>
{{#German Alternatives}}<span class="alts">{{German Alternatives}}</span><br/>{{/German Alternatives}}
<span class="alts"></span><br/>
{{#Sample sentence}}<span class="sentence">{{Sample sentence}}</span><br/>{{/Sample sentence}}
<span class="sentence"></span><br/>
{{#Plural and inflected forms}}<div class="plural">Plural: {{Plural and inflected forms}}</div>{{/Plural and inflected forms}}

{{FrontSide}}

<hr id="answer" />

{{English}}<br/>
{{#Picture}}{{Picture}}<br/>{{/Picture}}
<span class="alts"></span>
{{#English Alternatives}}<span class="alts">{{English Alternatives}}</span><br/>{{/English Alternatives}}

